INSERT INTO `librarybook` VALUES ('02f93a08-9c8a-4ff5-ae3f-6a443193c1e5', '霍乱时期的爱情', '978-7-5442-5897-5', '加夫列尔·加西亚·马尔克斯', '南海出版社', '该小说讲述了一段跨越半个多世纪的爱情故事：男女主人公在二十岁的时候没能结婚，因为他们太年轻了；经过各种人生曲折之后，到了八十岁，他们还是没能结婚，因为他们太老了。在五十年的时间跨度中，作者展示了所有爱情的可能性，所有的爱情方式。该小说不仅表达了“经历爱情的折磨是一种尊严”，更重要的是展现了哥伦比亚的历史。', '图书馆B300', 'on', 'https://g-search1.alicdn.com/img/bao/uploaded/i4/i1/3322362474/O1CN01vY5DVS1U98qkjjyrS_!!0-item_pic.jpg_580x580q90.jpg_.webp');
INSERT INTO `librarybook` VALUES ('133227a0-443f-467b-8759-a09db613cc50', '百年孤独', '978-7-5442-5339-4', '加夫列尔·加西亚·马尔克斯', '南海出版社', '《百年孤独》，是哥伦比亚作家加西亚·马尔克斯创作的长篇小说，是其代表作，也是拉丁美洲魔幻现实主义文学的代表作，被誉为“再现拉丁美洲历史社会图景的鸿篇巨著”。', '图书馆A508', 'on', 'http://img.alicdn.com/img/i2/2073720051/O1CN017wmSy11CFP7Mlp0iC_!!0-saturn_solar.jpg_580x580q90.jpg_.webp');
INSERT INTO `librarybook` VALUES ('60496fa7-6c40-419d-a788-de1675ad1366', '计算机组成原理', '978-7-121-33462-7', '任国林', '电子工业出版社', '你也爱上计组吗', 'J3-205', 'off', 'https://pdcapi.capub.cn/image/mm6w22lyez2d2mrqez4t2mjqeztdcpjpn5yhil3enfzwwmrppfuxi5lcnfqw43lvf5rggmzpnfwwcz3fgiydemrqgyxwuz3nojsxa4tjnz2ge33pnmxtamjqgeydambqg4ztinjvgiytolzqgeydcmbqgaydomzugu2temjxl5kfalzqgeydcmbqgaydomzugu2temjxl5bdamjooruwmjtggi6s633qoqxwi2ltnmzc64demmzdamboobxgojtnhu2ta/a.png?size=800x800&t=20240911220447?size=800x800&t=20240911220447');
INSERT INTO `librarybook` VALUES ('89749919-84d8-41d3-b519-76479af59226', '斗罗大陆II绝世唐门', 'TJSSNMSL', '唐家三少', '太白文艺出版社', '这里没有魔法，没有斗气，没有武术，却有武魂。唐门创立万年之后的斗罗大陆上，唐门式微。一代天骄横空出世，新一代史莱克七怪能否重振唐门，谱写一曲绝世唐门之歌！', 'J1-303', 'off', 'https://g-search2.alicdn.com/img/bao/uploaded/i4/i3/2210422802722/O1CN01jksZ0f1Vyj2qClXbX_!!2210422802722.jpg_360x360q90.jpg_.webp');
INSERT INTO `librarybook` VALUES ('a53553b4-4c53-44d8-b0fe-ca8681fe4fcc', '明朝那些事儿', '978-7-5442-5897-6', '当年明月', '中国海关出版社', '《明朝那些事儿》主要讲述的是从1344年到1644年这三百年间关于明朝的一些故事 。以史料为基础，以年代和具体人物为主线，并加入了小说的笔法，语言幽默风趣。对明朝十六帝和其他王公权贵和小人物的命运进行全景展示，尤其对官场政治、战争、帝王心术着墨最多，并加入对当时政治经济制度、人伦道德的演义。', '图书馆B300', 'on', 'http://img.alicdn.com/img/i3/6184447102/O1CN01mT65U422KlqWsUzYU_!!0-saturn_solar.jpg_580x580q90.jpg_.webp');
INSERT INTO `librarybook` VALUES ('c294fe69-16f3-4980-8d7e-f612281a9014', '追风筝的人', '9787208061644', '卡勒德·胡赛尼', '上海人民出版社\n', '12岁的阿富汗富家少爷阿米尔与仆人哈桑情同手足。然而，在一场风筝比赛后，发生了一件悲惨不堪的事，阿米尔为自己的懦弱感到自责和痛苦，逼走了哈桑，不久，自己也跟随父亲逃往美国。', '1F-201', 'on', 'http://img.alicdn.com/img/i4/5560014186/O1CN01Tt9Pl71gnEthwpwNe_!!0-saturn_solar.jpg_580x580q90.jpg_.webp');
INSERT INTO `librarybook` VALUES ('dfd67618-6a94-4769-99d7-fea75364fe87', '情人', '9787555229049', '玛格丽特·杜拉斯', '上海译文出版社', '小说从不同的视角揭示了现代法国社会中男女对性爱的感悟和反思，折射出西方世界感情生活的不同侧面。是一部带有自传色彩的作品，以法国殖民者在越南的生活为背景，描写了一名贫穷的法国少女与富有的华裔少爷之间深沉而无望的爱情，笔触深达人性中某些最根本、最隐秘的特质，催人深思。', '1F-206', 'on', 'http://img.alicdn.com/img/i3/56106334/O1CN01VzG9o11wf1dL6nPeg_!!0-saturn_solar.jpg_580x580q90.jpg_.webp');
INSERT INTO `librarybook` VALUES ('f5412b6e-64a5-405c-ab2b-708272a51654', '活着', '978-7-5063-6543-7', '余华', '北京十月文艺出版社', '《活着》是中国当代作家余华创作的长篇虚构小说，首次发表于《收获》1992年第6期。\n《活着》讲述了在大时代背景下，随着内战、三反五反、大跃进、“文化大革命”等社会变革，徐福贵的人生和家庭不断经受着苦难，到了最后所有亲人都先后离他而去，仅剩下年老的他和一头老牛相依为命。小说以普通、平实的故事情节讲述了在急剧变革的时代中福贵的不幸遭遇和坎坷命运，在冷静的笔触中展现了生命的意义和存在的价值，揭示了命运的无奈，与生活的不可捉摸。', '图书馆A511', 'on', 'http://img.alicdn.com/img/i1/122353380/O1CN01uNj0kD1aq5gS0W1E5_!!0-saturn_solar.jpg_360x360q90.jpg_.webp');
INSERT INTO `librarybook` VALUES ('f5412b6e-64a5-405c-ab2b-708272a59834', '活着', '978-7-5063-6543-7', '余华', '北京十月文艺出版社', '《活着》是中国当代作家余华创作的长篇虚构小说，首次发表于《收获》1992年第6期。\n《活着》讲述了在大时代背景下，随着内战、三反五反、大跃进、“文化大革命”等社会变革，徐福贵的人生和家庭不断经受着苦难，到了最后所有亲人都先后离他而去，仅剩下年老的他和一头老牛相依为命。小说以普通、平实的故事情节讲述了在急剧变革的时代中福贵的不幸遭遇和坎坷命运，在冷静的笔触中展现了生命的意义和存在的价值，揭示了命运的无奈，与生活的不可捉摸。', '图书馆A511', 'on', 'http://img.alicdn.com/img/i1/122353380/O1CN01uNj0kD1aq5gS0W1E5_!!0-saturn_solar.jpg_360x360q90.jpg_.webp');

